  input: '"TEXT","F3XA","C00140590","June 19, 2007    Laura Sinran  RE:CALIFORNIA
    REPUBLICAN PARTY  ID C00140590  Amended June monthly (05/01/06-05/31/06)    In
    response to the FECs  inquiry dated June 8 we would like to submit a response.     The
    entry made on schedule A line 17 was incorrectly reported on that line. The deposit
    should have been reported on line 15 as an offset to operating expenditure. This
    check represents a refund check from the Us postmaster.    Your second paragraph
    deals with a 3,882.40 amount on line 15 a. There is no entry for that amount;
    we are going to assume that you were questioning an entry in the amount of 3341.72.
    This refund or overpayment from taxes  was shown in earlier months. There were
    payments made every month for taxes on Line 21b. You will not see the exact payment
    amount as the IRS through the payroll service ADP did not refund the entire amount
    remitted.    The next paragraph deals with payments on Schedule L B for Printing
    Voter registration cards and merchant fees.  The expenses deal with voter registration
    and as such were paid in the manner prescribed by the FEC in relation to this
    committee. The non-federal component was paid with Levin funds; the federal component
    was paid with 100 federal funds. You will see payments to the Monaco group reported
    as 100 % federal expenses which correlate to the Levin portion of the payments.
    Thus there was no transfer of impermissible funds.  The committee believes its
    actions were in compliance with previous instructions received from the FEC     In
    regards to the  H6 payment for printing for CD 50. The expense was for a generic  get
    out the vote piece and therefore we believe the expense was listed on the correct
    line. Please note that the committee did not make a transfer from the Levin account
    to the federal account; therefore in reality 100% of the expense was paid for
    with federal funds. Also, there was no mention of any federal candidates.      We
    have corrected the totals pulling incorrectly from the Levin Accounts. Please  note
    there was a deposit from 21st century for$ 7,100 which was erroneously reported
    both in April & May. We have corrected this issue.    In regards to the voided
    check to the Us postmaster; the check was not re-issued. The original check  However,
    since that payment was not allocated, there would be no issue with a prohibited
    transfer. The original check was written on March 9, 2006 and no goods or services
    were received from the post office for the original check.    We have moved the
    payment for registering voters from lime 21b to line 30 b.    Sincerely,    Fred
    Arjani  "'
